  input: TEXT,F3A,,"Prior to the Helvey for Congress campaign's establishing purchasing
    cards and other payment mechanisms, the candidate used his personal credit cards
    to pay for travel and other campaign expenses.  As of the campaign's first FEC
    report (for the period ended June 30, 2003), the aggregate amount of these unreimbursed
    expenditures was $13,240.  Guidance from the FEC indicated that these amounts
    should be shown as a loan from the candidate, Jay Helvey, rather than a short-term
    payable for unreimbursed expenses.  Instead of reimbursing the candidate for these
    expenses, the committee paid the monies directly to the candidate's credit card
    companies.  The reported 'loan' from the candidate was subsequently forgiven.  In
    calculating the candidate's personal funds contributions to the campaign for purposes
    of the Form 11 dated and submitted to the FEC on May 4, 2004, the personal campaign
    expenditures referenced above were not included in our calculation.  We therefore
    acted in good faith, believing that we were eligible at that time to receive contributions
    using the guidelines for increased contribution limits."
